const bcrypt = require("bcryptjs");

async function hashPassword(password) {
    let hashedPassword;
    bcrypt.hash(password, 10, function(err, hash) {
        hashedPassword = hash;
        consolg.log(hash);
        console.log(hashedPassword);
    });
    console.log(hashedPassword);
}

module.exports = {
    hashPassword
}
